import React, { useState, useEffect} from "react";
import PageTitle from "../components/Typography/PageTitle";
import { Card, CardBody } from "@windmill/react-ui";
import RoundIcon from "../components/RoundIcon";
import { GrTechnology } from "react-icons/gr";
import { FaBook, FaCode, FaDatabase } from "react-icons/fa";
import { SiCoursera } from "react-icons/si";

const curriculum = [
  {
    id: 1,
    icon: FaDatabase,
    name: "Database Management Systems",
    faculty: "John Doe",
  },
  {
    id: 2,
    icon: FaCode,
    name: "Data Structures",
    faculty: "John Doe",
  },
  {
    id: 3,
    icon: FaBook,
    name: "Computer Architecture",
    faculty: "John Doe",
  },
  {
    id: 4,
    icon: GrTechnology,
    name: "Internet Of Things",
    faculty: "John Doe",
  },
];

function Mycourse() {
  const rollno = "7376211CS239";
  const semester = "6";
  const [assignedcoursedata,setAssignedcoursedata] = useState([]);
  useEffect(() => {
    async function fetchData() {
      try {
        const response = await fetch(
          `http://localhost:5555/myassignedcourse/${rollno}/${semester}`
        );
        const data = await response.json();
        const mappedData = data.map((courseassigned) => ({
          rollno: courseassigned.rollno,
          name: courseassigned.name,
          department: courseassigned.department,
          coreSubject1: courseassigned.coreSubject1,
          coreSubject2: courseassigned.coreSubject2,
          coreSubject3: courseregistered.coreSubject3,
          coreSubject4: courseregistered.coreSubject4,
          electivecourse_1: courseregistered.electivecourse_1,
          electivecourse_2: courseregistered.electivecourse_2,
          open_electivecourse: courseregistered.open_electivecourse,
          addon_course: courseregistered.addon_course,
          honoursCourses1: courseregistered.honoursCourses1,
          honoursCourses2: courseregistered.honoursCourses2,
        }));
        setAssignedcoursedata(mappedData);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    }
    fetchData();
  }, []);

  return (
    <>
      <PageTitle>My Course</PageTitle>

      <div className="grid gap-6 mb-8 md:grid-cols-2 xl:grid-cols-4">
        {curriculum.map((course) => (
          <Card key={course.id}>
            <CardBody className="flex flex-col items-center">
              <RoundIcon
                icon={SiCoursera}
                iconColorClass="text-orange-500 dark:text-orange-100"
                bgColorClass="bg-orange-100 dark:bg-orange-500"
                className="mx-auto mb-4"
              />
              <div className="text-center">
                <p className="text-lg font-semibold text-gray-700 dark:text-gray-200">
                  {course.name}
                </p>
                <p className="text-lg font-medium text-gray-700 dark:text-gray-200">
                  {course.faculty}
                </p>
              </div>
            </CardBody>
          </Card>
        ))}
      </div>
    </>
  );
}

export default Mycourse;
